description:
Studio : Sweetheart Video
Director: Dana Vespoli
Cast: Ashlyn Molloy, August Ames, Cherie DeVille, Dana Vespoli, Dani Daniels, India Summer, Penny Pax, Sovereign Syre

Welcome to the 16th installment of this critically acclaimed series. In this latest volume, nerdy Penny Pax gets revenge after spoiled brat August Ames bullies her for the last time. Both girls end up wrestling in the pool. Controversial writer India Summer gets a lecture from publicist Sovereign Syre after India's latest op-ed piece crosses the line. Cross country coach Cherie DeVille must persuade her star runner Ashlyn Molloy to stay on the team. Popular artist Dani Daniels finds out girlfriend Dana Vespoli has been cheating. Dana begs Dani for one last passionate kiss.

